import './App.css';
import android from '../cookies/android';
import smile from '../cookies/smile';


function Cookies() {
    let cookiesList = [];

    cookiesList.push({
        "id": 0,
        "image":"..\cookies\smile.jpg",
        "name": "Mini",
        "price": "1"
    },
    {
        "id": 1,
        "image":"..\cookies\android.jpg",
        "name": "Large",
        "price": "2.5"
    })

    return ( 
        <div className="App">
      <header className="App-header">
        <div className = "cookiesList">
            {cookiesList.map(cookie => <div key = {cookie.id} className = "cookie">
                <img src={cookie.image}></img>
                <h3>{cookie.name}</h3>
                <p>{cookie.price} K.D.</p>
            </div>)}
        </div>
      </header>
    </div>
  );
}

export default Cookies;
